import { AppBar, IconButton, Menu, Toolbar, Typography } from '@mui/material';
import React from 'react';

function Navbar() {
    return (
        <AppBar>
            <Toolbar>
                <IconButton>
                <MenuIcon></MenuIcon>
                </IconButton>
                <Typography variant="h6">
                    Live Score
                </Typography>
            </Toolbar>
        </AppBar>
    );
}

export default Navbar;
